{"name": "create_performance_optimization_indexes", "query": "
-- Index for participants_events to speed up filtering and grouping
CREATE INDEX IF NOT EXISTS idx_participants_events_participant_id 
ON participants_events(participant_id);

CREATE INDEX IF NOT EXISTS idx_participants_events_event_id 
ON participants_events(event_id);

-- Composite index for the stats table to handle the WHERE clause efficiently
-- This covers: stat_holder_id, stat_holder_type (for filtering) and stat_repository_type (for DISTINCT)
CREATE INDEX IF NOT EXISTS idx_stats_holder_lookup 
ON stats(stat_holder_id, stat_holder_type) 
WHERE stat_holder_type = 'persons';

-- Additional index for DISTINCT stat_repository_type queries
CREATE INDEX IF NOT EXISTS idx_stats_holder_and_repo_type 
ON stats(stat_holder_id, stat_holder_type, stat_repository_type) 
WHERE stat_holder_type = 'persons';

-- Index for events table to speed up the start_date_time lookup
CREATE INDEX IF NOT EXISTS idx_events_id_start_date 
ON events(id, start_date_time);

-- Comment documenting the optimization strategy
COMMENT ON INDEX idx_participants_events_participant_id IS 'Optimizes GROUP BY and WHERE on participant_id';
COMMENT ON INDEX idx_stats_holder_lookup IS 'Partial index for stats lookups filtered by persons type';
COMMENT ON INDEX idx_stats_holder_and_repo_type IS 'Covers DISTINCT stat_repository_type queries for persons';
COMMENT ON INDEX idx_events_id_start_date IS 'Optimizes event date lookups in joins';
"}
